css:
@-moz-document domain("web.whatsapp.com") {
/*
  Restyling of Whatsapp webapp.

  Source code:
  https://userstyles.org/styles/141440/graymazing-whatsapp
  https://github.com/sbriskin/userstyles.org
*/

.app {
    position: fixed !important;
    width: 100% !important;
    height: 100% !important;
    margin-top: 0px;
    top: 0px !important;
    left: 0px !important;
  }

  .pane-one {
    width: 33% !important;
    min-width: 280px !important;
  }

  .pane-two {
    width: 100% !important;
  }

  .pane-three {
    width: 300px !important;
    left: calc(100% - 300px) !important;
    position: fixed !important;
    z-index: 100 !important;
  }

.drawer-header {
    background-color: #c0c0c0 !important;
    color: #FFF !important;
}

.drawer-section-title {
    color: #555;
}

.checkbox.checked {
    background-color: #707070 !important;
    border-color: #707070;
}


.message-out {
    background-color: #cfcfcf !important;
}

.msg:hover .msg-select:hover {
    background-color: rgba(0,0,0,0.2);
    border: none !important;

}

.msg:selected .msg-select:selected {
    background: none;
    border: 1px solid green !important;

}

div.context-out.context {
    background: #cfcfcf !important;
}

span.tail-container {
    background-image: none !important;
    background: none !important;
    display: none !important;
}

div.pane-body.pane-chat-tile-container {
    background-color: #909090 !important;
    background-image: url('data:image/png;base64,') !important;
    background-position: left top !important;
    background-repeat: repeat !important;
}

div.block-compose{
    border: 0px solid #F5F5F5 !important;
    background-color: #F5F5F5;
}

.input-container {
    border: 1px solid #C5C5C5 !important;
}

.drawer-header-popup {
    background-color: #909090 !important;
}

.list-title {
    color: #909090;
}

#wrapper:before {
    background-color: #808080;
}
}
